import{_ as t,c as e,o as i,ah as n}from"./chunks/framework.CyOEM546.js";const d=JSON.parse('{"title":"⚙️ 其他类社团","description":"","frontmatter":{},"headers":[],"relativePath":"zh-cn/associations/others.md","filePath":"zh-cn/associations/others.md","lastUpdated":1756471203000}'),o={name:"zh-cn/associations/others.md"};function h(r,a,l,p,s,c){return i(),e("div",null,a[0]||(a[0]=[n('<h1 id="⚙️-其他类社团" tabindex="-1">⚙️ 其他类社团 <a class="header-anchor" href="#⚙️-其他类社团" aria-label="Permalink to &quot;⚙️ 其他类社团&quot;">​</a></h1><h2 id="职业发展协会" tabindex="-1">职业发展协会 <a class="header-anchor" href="#职业发展协会" aria-label="Permalink to &quot;职业发展协会&quot;">​</a></h2><p>职业发展协会（Career Development Association，简称 CDA）创始于 2007 年，曾两度获五星社团，常年保持四星社团。职协秉持“服务广大同学，增强就业能力”的宗旨，十余年发展间举办各种职业类活动，为同学们提供零距离体验职场环境的平台。并长期协助学生职业发展处举办国际研究生教育展等，掌握优秀的校友资源。同时主办留学经验分享会，为广大 UICer 未来发展提供更好的渠道。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NU8lT4U8LboRN8Ltl-boRn2ozlYUNnjknm94L7VVnl-DolU0gihFp2hmCIa0MkyPM1h2MYybMlUiLzT2olM7oz-sMz-8MRUioRGDL4UsLznFozUDMmlYL4VFLz-ZoRNJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="创行团队" tabindex="-1">创行团队 <a class="header-anchor" href="#创行团队" aria-label="Permalink to &quot;创行团队&quot;">​</a></h2><p>Enactus 创行 创立于 2008 年，是一个青年体验式学习成长平台。我们致力于发扬正直、热情、创新、合作的优秀品质，传承创行热血青年的使命和愿景。通过商业创新和实践为青年人才铺好创业发展路途，为社会带来积极影响。成立 16 年来，开展并运营超过 20 个特色项目，同时带领团队拿下几十项奖项，夺得无数荣誉。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NM7CTYMl-iMRlDntmNYnNrfU4NPU4GjaMl7aol-ZnNr7Ul70gihFp2hmCIa0M1hfMkysLSyPnRCYn7VVM7r2MzfkU8lsM4CPLzUYn7rkUmMFU8MVoz6VnRfFLzW7U4UJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="尖峰创想社" tabindex="-1">尖峰创想社 <a class="header-anchor" href="#尖峰创想社" aria-label="Permalink to &quot;尖峰创想社&quot;">​</a></h2><p>理想与现实的距离到底有多远？</p><p>加入 TEDxBNBU，找到你心中满意的答案。作为 TED TALK 于 2009 年推出的独立项目，TEDxBNBU 旨在鼓励世界各地的 TED 粉丝们自发地组织与 TED 相关的活动。TEDxBNBU 也一贯遵循 TED 的理想，致力于让一切有价值的想法和创意不再受到各种“不可抗力”的约束。和一群优秀的的小伙伴们以演讲，沙龙，和展览来让让思想流动，让创意落地！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NUN7T4UNQRL87sMtzrfU4NiM77YMlUjZoz98Lm9iolLDM4N0gihFp2hmCIa0n1y8UYy4UYybM4Wfn7n7Mmf7M7-iU8-8L7-8MR9Zn7WRn7QFol-aM8Q2nmWFLzG8UN7Jv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="创野社" tabindex="-1">创野社 <a class="header-anchor" href="#创野社" aria-label="Permalink to &quot;创野社&quot;">​</a></h2><p>创野社（Wall Free Club），简称 WFC，创立于 2012 年，曾是 BNBU 唯一的社企。目前正计划在校内重新启动创野水吧项目，通过售卖咖啡的方式来进行慈善活动。除此之外，我们还为学校师生带来 GOGOG0、咖啡文化节等传统活动，从不停止在创新创意道路上的奔跑脚步。</p><p>加入创野，成为梦想家，探素无限可能！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL8VT2LRLbM8W2ntmCbU4Uan7-PM7QjVoll8LmMVUzCYM8C0gihFp2hmCIa0MSyZUYhVn1yDLmvaoR-bMRUbMz9DL4rkMmW7U4n7LzWkLNQFMNWVo7UaL4VFLz7ZMRNJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="饮食文化社" tabindex="-1">饮食文化社 <a class="header-anchor" href="#饮食文化社" aria-label="Permalink to &quot;饮食文化社&quot;">​</a></h2><p>饮食文化社，一个致力于品尝美食、学习美食、制作美食的文化品鉴社团。本社团会举办奶茶节、蛋糕节、美食节等高自由度美食品鉴活动，在这里，你不仅能够了解到每一道美食的文化，而且还可以亲手制作并分享给其他同学。饮食文化社以品鉴和操作为先，在体味饮食风采的同时学习如何制作。此外，我们还会不定期举办探店等活动，并在饮食文化社公众号发布，为同学们推荐更多的美食，丰富同学们的校园生活。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMmvTsUzLZUmWfLtzTVMzAfo7UPL7CjbLmWVUz-8nll4ozG0gihFp2hmCIa0n1yiM1hVoShVL4C8nmT7U8lYMNWRLR9PU4-ZozTfM7lPMNQFM4U4M4GanRnFLz-DnlCJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="播音主持协会" tabindex="-1">播音主持协会 <a class="header-anchor" href="#播音主持协会" aria-label="Permalink to &quot;播音主持协会&quot;">​</a></h2><p>播音主持协会是一个专注于播音与主持艺术的学生社团，为热爱舞台和声音的同学们提供一个锻炼和展示自我的平台。协会下设三个部门：行政部、宣传部、策划部。协会共设两个栏目，表演栏目包括舞台配音表演，成员可以在舞台上展示自己的声音演绎才能。主持栏目则为校园内外的各类活动提供主持服务，帮助成员提升现场表现力和沟通技巧。</p><p>无论是对播音主持有兴趣的初学者，还是希望提升舞台表现力的资深爱好者，播音主持协会都是你施展才华的理想舞台。欢迎加入我们，成为声音的使者，舞台的明星！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL49TDLmAkUzTfMtz-anzMVUm-4o77jboR-DLz6VozNYLzl0gihFp2hmCIa0n1h2USyYLkyinlW2U8LPnzGYMzVVn7nVLzARUm-aoR94M4nFMR9iLRCZLzrFn7rRoSbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-bLkbw62w8c&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p>',22)]))}const M=t(o,[["render",h]]);export{d as __pageData,M as default};
